    if (!tree.iconPath) {
      cmds += ' class="_' + cmd + '">';
    } else if (tree.iconPath === '_') {
      var s = cmd.indexOf(suffix) + 1 ? 'none' : 'underline';
      cmds += ' style="text-decoration:' + s + ';">' + tree.cmdList[key].label;
    } else {
      cmds += '><img src="' + tree.icons[cmd].src + '" alt="" />';
    }
    cmds += '</a>';
    return cmds;
